import React from "react";
import './Navbar.css';

const Navbar = () => {
    return (

        <nav className="navbar">
            <a href="#" className="navbar-icon">
                <svg width="24" height="24" xmlns="http://www.w3.org/2000/svg">
                    <circle cx="12" cy="12" r="10" fill="currentColor" />Nav
                </svg>

            </a>

        </nav>
    )
}

export default Navbar;
